import React from "react";
import axios from 'axios';
import { async } from "q";

const cc = require('cryptocompare');
cc.setApiKey('cb0651451a197dfd1bb8c38e722be7c1eaf436b567eb027eedf3444322a2781e');



const User = () => {

  componentDidMount = () => {
  this.fetchCoins();
  }
  fetchCoins = async () => {
    let coinList = (await cc.coinList());
    console.log(coinList);
  }


  return (
    <div>
      <div className="sidebarUser">
        <div className="barUser">
          BTC
        </div>
        <ul>
          <li className="userMenu">
            <ul className="userMenuList">
              <li>
                <a>Inicio</a>
              </li>
              <li>
                <a>Enviar</a>
              </li>
              <li>
                <a>Recibir</a>
              </li>
              <li>
                <a>Ayuda</a>
              </li>
            </ul>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default User;
